        )
            .then(res => res.json())
            .then((data) => {
                this.setState({ members: data })
                console.log(this.state.members)
            })


        fetch('https://gitlab.com/api/v4/projects/19488109/issues?per_page=100',
            {
                headers: {
                    'Private-Token': 'AGN7CEcDXss1xRubmb2F',
                }
            }
        )
            .then(res => res.json())
            .then((data) => {
                this.setState({ issues: data })
